public class Solution {
    public int MinimumSeconds(IList<int> nums) {
        int n = nums.Count;
        int[] next = new int[n];
        for (int i = 0; i < n; i++) next[i] = i;
        bool changed = true;
        int ans = 0;
        while (changed) {
            changed = false;
            int[] newNext = new int[n];
            for (int i = 0; i < n; i++) newNext[i] = next[next[(i + 1) % n]];
            for (int i = 0; i < n; i++) {
                if (nums[i] != nums[newNext[i]]) changed = true;
                next[i] = newNext[i];
            }
            if (changed) ans++;
        }
        return ans;
    }
}
